import 'dart:convert';

import 'package:collection/collection.dart';


class PostModels {
  final int? userId;
  final int? id;
  final String? title;
  final String? body;

  const PostModels({this.userId, this.id, this.title, this.body});

  @override
  String toString() {
    return 'PostModels(userId: $userId, id: $id, title: $title, body: $body)';
  }

  factory PostModels.(
      Map<String, dynamic> data) {
    return PostModels(
      userId: data['userId'] as int?,
      id: data['id'] as int?,
      title: data['title'] as String?,
      body: data['body'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'userId': userId,
      'id': id,
      'title': title,
      'body': body,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [PostModels].
  factory PostModels.fromJson(String data) {
    return PostModels
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [PostModels] to a JSON string.
  String toJson() => json.encode(
      ());

  PostModels copyWith({
    int? userId,
    int? id,
    String? title,
    String? body,
  }) {
    return PostModels(
      userId: userId ?? this.userId,
      id: id ?? this.id,
      title: title ?? this.title,
      body: body ?? this.body,
    );
  }

  @override
  bool operator ==(Object other) {
    if (identical(other, this)) return true;
    if (other is! PostModels) return false;
    final mapEquals = const DeepCollectionEquality().equals;
    return mapEquals(
        other
            .(),
        ());
  }

  @override
  int get hashCode =>
      userId.hashCode ^ id.hashCode ^ title.hashCode ^ body.hashCode;
}
